column2:
In base-9, we perform the addition similarly to base-10 addition, but carrying over when the sum of digits is 9 or greater.

Starting with the rightmost digits, we have 1+1=2. Now, moving to the next digits, we have 5+4=9. Since 9 is equal to the base, we carry over 1 and write down 0 in the result. So, the final result is 102 in base-9.

\boxed{102}
